// Build a quick lookup map (case-insensitive)
export type RackElevationMap = Record<string, string>;
export const rackElevationByDC: RackElevationMap = dataCenterLinks.reduce((acc, item) => {
  acc[item.name.toUpperCase()] = item.url;
  return acc;
}, {} as RackElevationMap);

export function getRackElevationUrl(dc?: string): string | undefined {
  if (!dc) return undefined;
  return rackElevationByDC[(dc || "").toUpperCase()];
}

export default rackElevationByDC;

